  return (
  <header><Link to='/'><img src={logo} alt='Neighborhood Library' /></Link>
{currentUser && <Link><p>Add Book</p></Link>}
{currentUser ? (<p>Hello, {currentUser.username}!</p>) : (<Link to='/login'>Login</Link>)}
